<!DOCTYPE html>
<html lang="en-US" style="height: 100%;">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <meta name="mobile-web-app-capable" content="yes">
    <meta name="apple-mobile-web-app-capable" content="yes">
    <title>Black Jack</title>

    <!-- <link rel="stylesheet" href="css/style.css" rel="stylesheet"> -->
    <link rel="stylesheet" href="css/style.min.css" rel="stylesheet">
    <link rel="stylesheet" href="https://fonts.googleapis.com/icon?family=Material+Icons">
    <link rel="icon" href="images/favicon.ico" type="image/x-icon">
    <link rel='stylesheet' href='https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.3.1/css/bootstrap.min.css' />
    <script src='https://cdnjs.cloudflare.com/ajax/libs/jquery/3.3.1/jquery.min.js'></script>
</head>

<body class="text-light bg-dark">
    <header class="container-fluid">
        <div class="row">
            <div class="col-md-3">
                <span id="title">Blackjack</span><br>
                <!-- <h4>by Steven Hall</h4> -->
                <button id="beginGameButton" class="btn btn-primary">Begin
                    <i class="material-icons md-18">play_arrow</i>
                </button>
            </div>
            <div class="col-md-3">
                <div id="textArea"></div>
            </div>
        </div>
    </header>

    <section id="gameBoard" class="container-fluid bg-success border border-success rounded">
        <hr>
        <div id="dealerSection" class="row">
            <div class="col-md-2">
                <div id="dealerHas">Dealer</div>
                <div id="dealerTotal" class="score">Score: </div>
            </div>
            <div class="col-md-10">
                <div id="dealerHand" class="cards"></div>
            </div>
        </div>
        <hr>
        <div id="playerSection" class="row">
            <div class="col-md-2">
                <div id="playerHas">Player</div>
                <div id="playerTotal">Score: </div>
            </div>
            <div class="col-md-10">
                <div id="playerHand"></div>
            </div>
        </div>
        <hr>
    </section>

    <section id="buttonsSection" class="container-fluid mt-3">
        <div class="row">
            <div class="col-md-3 offset-md-2">
                <button id="newGameButton" class="btn btn-primary">New Game
                    <i class="material-icons md-18">play_arrow</i>
                </button>
                <button id="hitButton" class="btn btn-success">Hit!
                    <i class="material-icons md-18">file_download</i>
                </button>
                <button id="stayButton" class="btn btn-danger">Stay
                    <i class="material-icons md-18">not_interested</i>
                </button>
            </div>
        </div>
    </section>

    <!-- <script type="text/javascript" src="js/script.js"></script> -->
    <script type="text/javascript" src="js/script.min.js"></script>
